## Step 1: The derivation of $\hat{B}_{m x . c}^{\dagger}$

When the sum-of-squares matrix of $\{X\} \cup \boldsymbol{C}$ is invertible, by using the idea of the subderivative, for $p=1$, we find that the values of $B_{m x . c}, B_{m z . x \bar{x}}$ and $B_{m \bar{x} . x z}$ that minimize equation (8) are given by

$$
\left(\begin{array}{c}
\hat{B}_{m x . c}^{\dagger} \\
\hat{B}_{m z . x \bar{x}}^{\dagger} \\
\hat{B}_{m \bar{x} . x z}^{\dagger}
\end{array}\right)=\left(\begin{array}{c}
\hat{B}_{m x . c} \\
\hat{B}_{m z . x \bar{x}} \\
\hat{B}_{m \bar{x} . x z}
\end{array}\right)-n \rho_{1}\left(\begin{array}{cccc}
S_{x x} & S_{x z} & S_{x \bar{x}} \\
S_{z x} & S_{z z} & S_{z \bar{x}} \\
S_{\bar{x} x} & S_{\bar{x} z} & S_{\bar{x} \bar{x}}
\end{array}\right)^{-1}\left(\begin{array}{c}
\boldsymbol{0}_{q_{m}}^{T} \\
\boldsymbol{0}_{q_{z} . q_{m}} \\
\gamma_{m \bar{x} . x z} \odot \operatorname{sign}\left(\hat{B}_{m \bar{x} . x z}^{\dagger}\right)
\end{array}\right)
$$

Then, letting

$$
\left(\begin{array}{lll}
S_{x x} & S_{x z} & S_{x \bar{x}} \\
S_{z x} & S_{z z} & S_{z \bar{x}} \\
S_{\bar{x} x} & S_{\bar{x} z} & S_{\bar{x} \bar{x}}^{\bar{x} \bar{x}}
\end{array}\right)^{-1}=\left(\begin{array}{lll}
S^{x x} & S^{x z} & S^{x \bar{x}} \\
S^{z x} & S^{z z} & S^{z \bar{x}} \\
S^{\bar{x} x} & S^{\bar{x} z} & S^{\bar{x} \bar{x}}
\end{array}\right)
$$

since we have

$$
\binom{S^{x \bar{x}}}{S^{z \bar{x}}}=\binom{-\hat{B}_{\bar{x} x . z} S_{\overline{x z}, x z}^{-1}}{-\hat{B}_{\bar{x} z . x} S_{\overline{x z} . x z}^{-1}}
$$

from the blockwise inversion formula of the invertible matrix (Bernstein, 2009), we derive

$$
\begin{aligned}
\hat{B}_{m x . c}^{\dagger} & =\hat{B}_{m x . c}-n \rho_{1} S^{x \bar{x}} \gamma_{m \bar{x} . x z} \odot \operatorname{sign}\left(\hat{B}_{m \bar{x} . x z}^{\dagger}\right) \\
& =\hat{B}_{m x . c}+n \rho_{1} \hat{B}_{\bar{x} x . z} S_{\overline{x z} . x z}^{-1} \gamma_{m \bar{x} . x z} \odot \operatorname{sign}\left(\hat{B}_{m \bar{x} . x z}^{\dagger}\right)
\end{aligned}
$$

Step 2: The derivation of $\hat{\beta}_{y x . c m}^{\dagger}, \hat{B}_{y s . x c \bar{s}}^{\dagger}$ and $\hat{B}_{y \bar{s} . x c s}^{\dagger}$
Similarly, when the sum-of-squares matrix of $\{X\} \cup \boldsymbol{C} \cup \boldsymbol{M}$ is invertible, by using the idea of the subderivative, for $p=1$, we find that the values of $\beta_{y x . c m}, B_{y s . x c \bar{s}}, B_{y z . x m \bar{s}}, B_{y \bar{s} . x c s}$ and $B_{y \bar{s} . x m z}$ that minimize equation (7) are given by

$$
\begin{aligned}
& \left(\begin{array}{c}
\hat{\beta}_{y x . c m}^{\dagger} \\
\hat{B}_{y s . x c \bar{s}}^{\dagger} \\
\hat{B}_{y z . x m \bar{s}}^{\dagger} \\
\hat{B}_{y \bar{s} . x c s}^{\dagger} \\
\hat{B}_{y \bar{s} . x m z}^{\dagger}
\end{array}\right)=\left(\begin{array}{c}
\hat{\beta}_{y x . c m} \\
\hat{B}_{y s . x c \bar{s}} \\
\hat{B}_{y z . x m \bar{s}} \\
\hat{B}_{y \bar{s} . x c s} \\
\hat{B}_{y \bar{s} . x m z}
\end{array}\right)-n \lambda_{1}\left(\begin{array}{cccccc}
s_{x x} & S_{x s} & S_{x z} & S_{x \bar{s}} & S_{x \bar{s}} & S_{x \bar{z}} \\
S_{s x} & S_{s s} & S_{s z} & S_{s \bar{s}} & S_{s \bar{s}} & S_{s \bar{z}} \\
S_{z x} & S_{z s} & S_{z z} & S_{z \bar{s}} & S_{z \bar{s}} & S_{z \bar{z}} \\
S_{\bar{s} x} & S_{\bar{s} s} & S_{\bar{s} z} & S_{\bar{s} \bar{s}} & S_{\bar{s} \bar{z}} \\
S_{\bar{z} x} & S_{\bar{z} s} & S_{\bar{z} z} & S_{\bar{z} \bar{s}} & S_{\bar{z} \bar{z}}
\end{array}\right)^{-1} \\
& \times\left(\begin{array}{c}
\zeta_{1} \operatorname{sign}\left(\hat{\beta}_{y x . c m}^{\dagger}\right) \\
\mathbf{0}_{q_{s}} \\
\mathbf{0}_{q_{z}} \\
\xi_{1} \gamma_{\bar{s} x . c} \odot \operatorname{sign}\left(\hat{B}_{y \bar{s} . x c s}^{\dagger}\right) \\
\left(1-\zeta_{1}-\xi_{1}\right) \gamma_{y \bar{s} . x m z} \odot \operatorname{sign}\left(\hat{B}_{y \bar{s} . x m z}^{\dagger}\right)
\end{array}\right)
\end{aligned}
$$

Then, letting

$$
\left(\begin{array}{cccccc}
s_{x x} & S_{x s} & S_{x z} & S_{x \bar{s}} & S_{x \bar{s}} & S_{x \bar{z}} \\
S_{s x} & S_{s s} & S_{s z} & S_{s \bar{s}} & S_{s \bar{s}} \\
S_{z x} & S_{z s} & S_{z z} & S_{z \bar{s}} & S_{z \bar{s}} \\
S_{\bar{s} x} & S_{\bar{s} s} & S_{\bar{s} z} & S_{\bar{s} \bar{s}} & S_{\bar{s} \bar{z}}
\end{array}\right)^{-1}=\left(\begin{array}{cccccc}
s^{x x} & S^{x s} & S^{x z} & S^{x \bar{s}} & S^{x \bar{s}} \\
S^{s x} & S^{s s} & S^{s z} & S^{s \bar{s}} & S^{s \bar{z}} \\
S^{z x} & S^{z s} & S^{z z} & S^{z \bar{s}} & S^{z \bar{z}} \\
S^{\bar{s} x} & S^{\bar{s} s} & S^{\bar{s} z} & S^{\bar{s} \bar{s}} & S^{\bar{s} \bar{z}} \\
S^{\bar{z} x} & S^{\bar{z} s} & S^{\bar{z} z} & S^{\bar{z} \bar{s}} & S^{\bar{z} \bar{z}}
\end{array}\right)
$$

we have

$$
\begin{aligned}
& \left(\begin{array}{cc}
s^{x x} & S^{x s} \\
S^{s x} & S^{s s}
\end{array}\right)=\left(\begin{array}{cc}
s_{x x . c m}^{-1} & -s_{x x . c \bar{s}}^{-1} S_{x s . c \bar{s}} S_{s s . c \bar{s}}^{-1} S_{s s . x c \bar{s}}^{-1} \\
-S_{s s . c \bar{s}}^{-1} & S_{s s . c \bar{s}}^{-1} S_{s s . x c \bar{s}}^{-1}
\end{array}\right) \\
& =\left(\begin{array}{cc}
s_{x x . c m}^{-1} & -\hat{B}_{s x . c \bar{s}}^{-1} S_{s s . x c \bar{s}}^{-1} \\
-\hat{B}_{x s . c \bar{s}}^{-1} & S_{s s . x c \bar{s}}^{-1}
\end{array}\right), \\
& \left(\begin{array}{cc}
S^{\bar{s} \bar{s}} & S^{\bar{s} \bar{s}} \\
S^{\bar{s} \bar{s}} & S^{\bar{s} \bar{s}}
\end{array}\right)=\left(\begin{array}{cc}
S_{\bar{s} \bar{s} . x c s}^{-1} & -S_{\bar{s} \bar{s} . x s c}^{-1} S_{\bar{s} \bar{s} . x s c}^{-1} S_{\bar{z} \bar{s} . x m z}^{-1} \\
-\left.S_{\bar{s} \bar{s} . x s c}^{-1} S_{\bar{s} \bar{s} . x s c}^{-1} S_{\bar{s} \bar{s} . x c s}^{-1} S_{\bar{s} \bar{s} . x m z}^{-1}\right) & \\
\left(\begin{array}{cc}
S_{\bar{s} \bar{s} . x c s}^{-1} & -\hat{B}_{\bar{s} \bar{s} . x s c} S_{\bar{s} \bar{s} . x c s}^{-1} \\
-\hat{B}_{\bar{s} \bar{s} . x s c} S_{\bar{s} \bar{s} . x c s}^{-1} & S_{\bar{s} \bar{s} . x m z}
\end{array}\right) \\
& =\left(\begin{array}{cc}
\hat{B}_{s z . \bar{s} \bar{s}}^{-1} \hat{B}_{x s . c \bar{s}}^{-1} S_{x z . c \bar{s}}^{-1} \hat{B}_{x z . \bar{s} \bar{s}}^{-1} \hat{B}_{x z . \bar{s} \bar{s}}^{-1} \hat{B}_{s x . c \bar{s}}^{-1} S_{s s . x c \bar{s}}^{-1} \\
\hat{B}_{s \bar{s} . c} \hat{B}_{x s . c \bar{s}}^{-1} \hat{B}_{x \bar{s} . c} \bar{s}_{x x . c c c}^{-1} & \hat{B}_{x \bar{s} . c} \hat{B}_{x s . c \bar{s}}^{-1} \hat{B}_{s \bar{s} . c} \hat{B}_{s x . c \bar{s}}^{-1} \hat{B}_{s \bar{s} . c} \hat{B}_{s x . c \bar{s}}^{-1} \\
\hat{B}_{s \bar{s} . c \bar{s}} \hat{B}_{x s . c \bar{s}}^{-1} \hat{B}_{x \bar{s} . c \bar{s}}^{-1} \hat{B}_{x \bar{s} . c \bar{s}}^{-1} \hat{B}_{x \bar{s} . c \bar{s}}^{-1} \hat{B}_{s \bar{s} . c \bar{s}}^{-1}
\end{array}\right), \\
& \left(\begin{array}{cc}
S^{x \bar{s}} & S^{x \bar{s}} \\
S^{x \bar{s}} & S^{x \bar{s}} \\
S^{z \bar{s}} & S^{z \bar{s}}
\end{array}\right)=-\left(\begin{array}{cc}
\hat{B}_{\bar{s} x . s z} & \hat{B}_{\bar{s} x . s z} \\
\hat{B}_{\bar{s} s . x z} & \hat{B}_{\bar{s} s . x z} \\
\hat{B}_{\bar{s} z . x s} & \hat{B}_{\bar{s} z . x s}
\end{array}\right)\left(\begin{array}{cc}
S_{\bar{s} \bar{s} . x c s}^{-1} & -\hat{B}_{\bar{s} \bar{s} . x s c} S_{\bar{s} \bar{s} . x m z}^{-1} \\
-\hat{B}_{\bar{s} \bar{s} . x s c} S_{\bar{s} \bar{s} . x c s}^{-1} & S_{\bar{s} \bar{s} . x m z}
\end{array}\right) \\
& =\left(\begin{array}{cc}
\hat{B}_{\bar{s} x . s z} \hat{B}_{\bar{s} \bar{s} . x s z} S_{\bar{s} \bar{s} . x c s}^{-1}-\hat{B}_{\bar{s} x . s z} \hat{S}_{\bar{s} \bar{s} . x c s}^{-1} & \hat{B}_{\bar{s} x . s z} \hat{B}_{\bar{s} \bar{s} . x s z} S_{\bar{s} \bar{s} . x c s}^{-1}-\hat{B}_{\bar{s} x . s z} \hat{S}_{\bar{s} \bar{s} . x m z}^{-1} \\
\hat{B}_{\bar{s} s . x z} \hat{B}_{\bar{s} \bar{s} . x s z} \hat{S}_{\bar{s} \bar{s} . x c s}^{-1}-\hat{B}_{\bar{s} s . x z} \hat{S}_{\bar{s} \bar{s} . x c s}^{-1} & \hat{B}_{\bar{s} s . x z} \hat{B}_{\bar{s} \bar{s} . x s z} S_{\bar{s} \bar{s} . x m z}^{-1}-\hat{B}_{\bar{s} s . x z} \hat{S}_{\bar{s} \bar{s} . x m z}^{-1}
\end{array}\right)
\end{aligned}
$$

from the blockwise inversion formula of the invertible matrix (Bernstein, 2009). Thus, we derive

$$
\hat{\beta}_{y x . c m}^{\dagger}=\hat{\beta}_{y x . c m}-n \lambda_{1}\left\{\zeta_{1} s^{x x} \operatorname{sign}\left(\hat{\beta}_{y x . c m}^{\dagger}\right)+\xi_{1} S^{x \bar{s}} \gamma_{\bar{s} x . c} \odot \operatorname{sign}\left(\hat{B}_{y \bar{s} . x c s}^{\dagger}\right)\right.
$$

$$
\begin{aligned}
& +\left(1-\zeta_{1}-\xi_{1}\right) S^{x \bar{x}} \boldsymbol{\gamma}_{y \bar{x} . x m z} \odot \operatorname{sign}\left(\hat{B}_{y \bar{x} . x m z}^{\dagger}\right)\right\} \\
= & \hat{\beta}_{y x . c m}-n \lambda_{1}\left\{\zeta_{1} s_{x x . c m}^{-1} \operatorname{sign}\left(\hat{\beta}_{y x . c m}^{\dagger}\right)-\xi_{1} \hat{B}_{\bar{x} x . s c} S_{\bar{x} \bar{x} . x c s}^{-1} \boldsymbol{\gamma}_{\bar{x} x . c} \odot \operatorname{sign}\left(\hat{B}_{y \bar{x} . x c s}^{\dagger}\right)\right. \\
& \left.-\left(1-\zeta_{1}-\xi_{1}\right) \hat{B}_{\bar{x} x . c m} S_{\bar{x} \bar{x} . x m z}^{-1} \boldsymbol{\gamma}_{y \bar{x} . x m z} \odot \operatorname{sign}\left(\hat{B}_{y \bar{x} . x m z}^{\dagger}\right)\right\}, \\
& \hat{B}_{y s . x c \bar{s}}^{\dagger}= & \hat{B}_{y s . x c \bar{s}}-n \lambda_{1}\left\{\zeta_{1} S^{s x} \operatorname{sign}\left(\hat{\beta}_{y x . c m}^{\dagger}\right)+\xi_{1} S^{s \bar{x}} \boldsymbol{\gamma}_{\bar{x} x . c} \odot \operatorname{sign}\left(\hat{B}_{y \bar{x} . x c s}^{\dagger}\right)\right. \\
& \left.+\left(1-\zeta_{1}-\xi_{1}\right) S^{s \bar{x}} \boldsymbol{\gamma}_{y \bar{x} . x m z} \odot \operatorname{sign}\left(\hat{B}_{y \bar{x} . x m z}^{\dagger}\right)\right\} \\
= & \hat{B}_{y s . x c \bar{s}}-n \lambda_{1}\left\{-\zeta_{1} \hat{B}_{x s . c \bar{s}} s_{x x . c m}^{-1} \operatorname{sign}\left(\hat{\beta}_{y x . c m}^{\dagger}\right)\right. \\
& \left.-\xi_{1} \hat{B}_{\bar{x} s . x c} S_{\bar{x} \bar{s} . x c s}^{-1} \boldsymbol{\gamma}_{\bar{x} x . c} \odot \operatorname{sign}\left(\hat{B}_{y \bar{x} . x c s}^{\dagger}\right)\right. \\
& \left.-\left(1-\zeta_{1}-\xi_{1}\right) \hat{B}_{\bar{x} s . x z \bar{s}} S_{\bar{x} \bar{x} . x m z}^{-1} \boldsymbol{\gamma}_{y \bar{x} . x m z} \odot \operatorname{sign}\left(\hat{B}_{y \bar{x} . x m z}^{\dagger}\right)\right\}, \\
& \hat{B}_{y \bar{s} . x c s}^{\dagger}= & \hat{B}_{y \bar{s} . x c s}-n \lambda_{1}\left\{\zeta_{1} S^{\bar{x} x} \operatorname{sign}\left(\hat{\beta}_{y x . c m}^{\dagger}\right)+\xi_{1} S^{\bar{x} \bar{x}} \boldsymbol{\gamma}_{\bar{x} x . c} \odot \operatorname{sign}\left(\hat{B}_{y \bar{x} . x c s}^{\dagger}\right)\right. \\
& \left.+\left(1-\zeta_{1}-\xi_{1}\right) S^{\bar{x} \bar{x}} \boldsymbol{\gamma}_{y \bar{x} . x m z} \odot \operatorname{sign}\left(\hat{B}_{y \bar{x} . x m z}^{\dagger}\right)\right\} \\
= & \hat{B}_{y \bar{s} . x c s}-n \lambda_{1}\left\{-\zeta_{1} \hat{B}_{x \bar{s} . c s} s_{x x . c m}^{-1} \operatorname{sign}\left(\hat{\beta}_{y x . c m}^{\dagger}\right)+\xi_{1} S_{\bar{x} \bar{s} . x c s}^{-1} \boldsymbol{\gamma}_{\bar{x} x . c} \odot \operatorname{sign}\left(\hat{B}_{y \bar{x} . x c s}^{\dagger}\right)\right. \\
& \left.-\left(1-\zeta_{1}-\xi_{1}\right) \hat{B}_{\bar{x} \bar{s} . x s z} S_{\bar{x} \bar{x} . x m z}^{-1} \boldsymbol{\gamma}_{y \bar{x} . x m z} \odot \operatorname{sign}\left(\hat{B}_{y \bar{x} . x m z}^{\dagger}\right)\right\}
\end{aligned}
$$

By combining the above equations, we derive

$$
\begin{aligned}
& \left(\begin{array}{c}
\hat{\beta}_{y x . c m}^{\dagger} \\
\hat{B}_{y s . x c \bar{s}}^{\dagger} \\
\hat{B}_{y \bar{s} . x c s}^{\dagger}
\end{array}\right)=\left(\begin{array}{c}
\hat{\beta}_{y x . c m} \\
\hat{B}_{y s . x c \bar{s}} \\
\hat{B}_{y \bar{s} . x c s}
\end{array}\right)+n \lambda_{1}\left(\begin{array}{ccc}
-1 & \hat{B}_{\bar{x} x . s c} & \hat{B}_{\bar{x} x . c m} \\
\hat{B}_{x s . c \bar{s}} & \hat{B}_{\bar{x} s . x c} & \hat{B}_{\bar{x} s . x z \bar{s}} \\
\hat{B}_{x \bar{s} . c s} & -I_{q_{\bar{x}}} & \hat{B}_{\bar{x} \bar{s} . x s z}
\end{array}\right) \\
& \times\left(\begin{array}{c}
\zeta_{1} s_{x x . c m}^{-1} \operatorname{sign}\left(\hat{\beta}_{y x . c m}^{\dagger}\right) \\
\xi_{1} S_{\bar{x} \bar{x} . x c s}^{-1} \boldsymbol{\gamma}_{\bar{x} x . c} \odot \operatorname{sign}\left(\hat{B}_{y \bar{x} . x c s}^{\dagger}\right) \\
\left(1-\zeta_{1}-\xi_{1}\right) S_{\bar{x} \bar{x} . x m z}^{-1} \boldsymbol{\gamma}_{y \bar{x} . x m z} \odot \operatorname{sign}\left(\hat{B}_{y \bar{x} . x m z}^{\dagger}\right)
\end{aligned}\right)
\end{aligned}
$$
